import Link from "next/link";
export default ({ post }) => {
	return (
		<li>
			<Link href="/p/[id]" as={`/p/${post.id}`}>
				{/* <a>{props.title}</a> */}
				<a>{post.title}</a>
			</Link>
		</li>
	);
};
